                        Frequently asked questions</h2>
                    <p class="mt-4 text-lg tracking-tight text-slate-700">If you canâ€™t find what youâ€™re looking for,
                        contact our support team and someone will get back to you shortly!</p></div>
                <ul role="list" class="mx-auto mt-16 grid max-w-2xl grid-cols-1 gap-8 lg:max-w-none lg:grid-cols-3">
                    <li>
                        <ul role="list" class="flex flex-col gap-y-8">
                            <li><h3 class="font-display text-lg leading-7 text-slate-900">Where are your numbers
                                    from?</h3>
                                <p class="mt-4 text-sm text-slate-700">Our numbers come from major US phone companies.
                                    We guarantee you can verify any service, even those that don't accept virtual
                                    numbers such as Google.</p></li>
                            <li><h3 class="font-display text-lg leading-7 text-slate-900">When do you get new
                                    numbers?</h3>
                                <p class="mt-4 text-sm text-slate-700">We restock our numbers throughout each day. If we
                                    happen to be out of a particular service, we recommend to keep checking back as we
                                    are continually restocking. We'll keep expanding our capabilities to provide the
                                    best service we can.</p></li>
                            <li><h3 class="font-display text-lg leading-7 text-slate-900">How long do your
                                    short-term/temporary numbers last?</h3>
                                <p class="mt-4 text-sm text-slate-700">All of our verification numbers are meant for
                                    short-term and temporary use. Once a verification has ended, the number may be
                                    removed at any time and we will no longer have access to that number. However, we do
                                    offer long-term phone number rentals if you need a temporary phone number for a
                                    longer time! Rentals can be rented from one day to an unlimited amount of time. <a
                                        aria-label="Learn about long-term phone number rentals"
                                        class="text-sky-700 underline hover:no-underline" href="rentals.html">Learn more
                                        about our rentals here</a>.</p></li>
                            <li><h3 class="font-display text-lg leading-7 text-slate-900">What can I use your numbers
                                    for?</h3>
                                <p class="mt-4 text-sm text-slate-700">Our numbers can be used for virtually any online
                                    service including popular ones like Amazon, Ticketmaster, and PayPal. You can use
                                    these numbers to register for new accounts, keep your information private, and stop
                                    one-time-codes (OTP) from spamming your personal phone. In addition, if a service is
                                    not listed, you can still get SMS codes from custom services!</p></li>
                        </ul>
                    </li>
                    <li>
                        <ul role="list" class="flex flex-col gap-y-8">
                            <li><h3 class="font-display text-lg leading-7 text-slate-900">Do you provide an API?</h3>
                                <p class="mt-4 text-sm text-slate-700">We do! Feel free to integrate and build your own
                                    applications using our numbers. <a aria-label="View API documentation"
                                                                       class="text-sky-700 underline hover:no-underline"
                                                                       href="docs/api/v2.html">Please click here for our
                                        API reference</a>.</p></li>
                            <li><h3 class="font-display text-lg leading-7 text-slate-900">How do I change my
                                    password?</h3>
                                <p class="mt-4 text-sm text-slate-700">You can <a aria-label="Change password"
                                                                                  class="text-sky-700 underline hover:no-underline"
                                                                                  href="app/account.html">click here to
                                        change your password</a>.</p></li>
                            <li><h3 class="font-display text-lg leading-7 text-slate-900">I have an issue/question! What
                                    do I do?</h3>
                                <p class="mt-4 text-sm text-slate-700">We have the quickest and best support team in the
                                    text verification service industry. Please <a
                                        aria-label="Get account help or contact us"
                                        class="text-sky-700 underline hover:no-underline" href="contact-us.html">contact
                                        our support staff with any issues</a> you have with your cryptocurrency
                                    payments, receiving codes, or general help. We appreciate your business and will get
                                    back to you shortly!</p></li>
                            <li><h3 class="font-display text-lg leading-7 text-slate-900">Are your payments secure?</h3>
                                <p class="mt-4 text-sm text-slate-700">Yes, our payments are secure and you can pay with
                                    card (using Stripe), or with a wide range of cryptocurrencies. We have been
                                    verifying since 2019 and have helped users complete millions of verifications.</p>
                            </li>
                        </ul>
                    </li>
                    <li>
                        <ul role="list" class="flex flex-col gap-y-8">
                            <li><h3 class="font-display text-lg leading-7 text-slate-900">Do you have any free phone
                                    numbers I could use?</h3>
                                <p class="mt-4 text-sm text-slate-700">We now provide <a
                                        aria-label="Use free phone numbers" href="_r%3Ft=free&amp;t=blog.html"
                                        class="text-sky-700 underline hover:no-underline">free non-VoIP numbers!</a>
                                    Free numbers are public and are in high demand, so your service may not be
                                    available. If you&#x27;re looking for a private number, we offer cheap <a
                                        aria-label="Get info on verifications" href="verifications.html"
                                        class="text-sky-700 underline hover:no-underline">verifications</a>, with many
                                    services starting at $0.25, and you will receive a refund if you do not receive your
                                    message or call. We offer <a aria-label="Get info on verifications"
                                                                 href="verifications.html"
                                                                 class="text-sky-700 underline hover:no-underline">text/voice
                                        verifications (one-time-use numbers)</a> and <a aria-label="Get info on rentals"
                                                                                        href="rentals.html"
                                                                                        class="text-sky-700 underline hover:no-underline">phone
                                        rentals (long-term numbers).</a></p></li>
                            <li><h3 class="font-display text-lg leading-7 text-slate-900">What makes your service
                                    different from Google Voice?</h3>
                                <p class="mt-4 text-sm text-slate-700">We offer services to verify your identity to
                                    register and login to online services (ex: Craigslist, Hinge, and even Google).
                                    Google Voice numbers are made to be used like an online personal phone. One of
                                    Google Voice's biggest weaknesses however is that it is a VoIP (Voice Over IP)
                                    number. When receiving an SMS verification, most services recognize that it's a fake
                                    phone number and will reject it. Instead, you should use our numbers to bypass this
                                    limitation.</p></li>
                            <li><h3 class="font-display text-lg leading-7 text-slate-900">I live internationally, can I
                                    still use your numbers?</h3>
                                <p class="mt-4 text-sm text-slate-700">Absolutely! Our numbers are all based in the US,
                                    but you can still get messages through our website if you live in places like India,
                                    the UK, Russia, Canada, Germany, Nigeria, etc. Note: You may only be able to
                                    register for a US account with a US number depending on the service.</p></li>
